import {
    MDBRow,
    MDBCol,
    MDBBtn,
    MDBInputGroup,
    MDBSwitch,
} from 'mdb-react-ui-kit';

const Filter = () => {
    return (
        <MDBRow tag="form" className="row-cols-lg-auto g-3 align-items-center">
            <MDBCol>
                <MDBSwitch label="Remember me" />
            </MDBCol>
        </MDBRow>
    );
};

export default Filter;
